import React, { Component }from 'react';
import {View, Text, StyleSheet, Image} from 'react-native';

export default class PeopleDetailsPage extends Component{
    constructor(props){
        super(props)
        this.state={
            "people": props.route.params.people,
        }
    }
    render(){
        return(
            <View style={styles.layout}>
                <Text >Nome: {this.state.people.name.first}</Text>
                <Text >Sobrenome: {this.state.people.name.last}</Text>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    layout: {
        paddingTop: 10,
        paddingLeft: 15
    },

    texto: {
        fontSize: 20,
    },

    avatar: {
        aspectRatio: 1,
        marginLeft: 10,
        flex: 1,
        borderRadius: 50
    },
})
